import { Trans } from '@lingui/macro'
import { merge } from 'lodash-es'
import React from 'react'
import { DndBlockItem } from '../../../types'
import { styleToCss } from '../../../utils'
import Image from '../../components/Image'
import Text from '../../components/Text'

export default {
    id: 'imageRightTextLeft',
    label: <Trans>Image Right Text Left</Trans>,
    render: (renderProps) => {
        if (!renderProps.item) {
            return null
        }
        const state = renderProps.state.entities[renderProps.item.id].values
        return (
            <>
                <div style={state.item.style}>{Text.render(renderProps, 'text-1')}</div>
                <div style={state.item.style}>{Image.render(renderProps, 'image-1')}</div>
            </>
        )
    },
    export: (renderProps) => {
        if (!renderProps.item) {
            return null
        }
        const state = renderProps.state.entities[renderProps.item.id].values
        return `
            <div style="${styleToCss(state.item.style)}"> 
                ${Text.render(renderProps, 'text-1')}
            </div>
            <div style="${styleToCss(state.item.style)}">
                ${Image.render(renderProps, 'image-1')}
            </div>
        `
    },
    image:
        'data:image/png;base64,',
    initialValues: {
        item: {
            style: {
                padding: '4px 4px 4px 4px',
                alignItems: 'inherit',
                justifyContent: 'inherit',
                display: 'flex'
            }
        },
        'image-1': merge({}, Image.initialValues, {
            label: 'Image',
            style: {
                width: '120px'
            }
        }),
        'text-1': merge({}, Text.initialValues, {
            label:
                'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Animi dolorem expedita laudantium nulla, quod ratione repellat velit. Ab adipisci, aliquam consequuntur doloribus eius error fugit harum officia optio velit voluptatem.'
        })
    },
    parent: 'image',
    settings: [
        {
            id: 'image-1',
            label: <Trans>Image - 1</Trans>,
            type: 'image',
            settings: Image.settings
        },
        {
            id: 'text-1',
            label: <Trans>Text - 1</Trans>,
            type: 'text',
            settings: Text.settings
        }
    ],
    type: 'block'
} as DndBlockItem
